                      },
                      children: "Business users, such as sales, marketing, product, and operations managers, like to use data analysis to inform their decisions to improve business processes and outcomes, despite having limited formal technical training. While earlier research has focused on data analysts' and data scientists' practices and challenges in data analysis, little is known about how business users incorporate data and visual analytics into their workflows. To address this gap, we conduct an interview study with 22 business users to understand the general practices and challenges in their data-driven decision-making processes. Drawing from our study findings, we contribute an end-to-end model of their data-driven decision-making processes comprising five stages: (1) Acquire and Calibrate Data, (2) Augment Drivers and KPIs using Business Expertise, (3) Understand and Model Driver-KPI Relationships, (4) Communicate with Stakeholders, and (5) Validate Feasibility through A/B Testing. We elaborate on the tasks, tools, and challenges at each stage. We find that business users cannot rely on data analysts for data analysis due to various practical constraints, such as the limited availability of data analysts, communication inefficiencies, business pressure to make quick decisions, and the need to incorporate domain knowledge, which data analysts often lack. Additionally, our findings suggest existing analysis tools are inadequate in helping business users comprehend the relationships between data variables and business goals and facilitating the exploration of what-if scenarios crucial for informed decision-making. Finally, we discuss the opportunities in designing future data and visual analytics systems for business users, emphasizing the need for augmented advanced analytics such as what-if analysis functionalities enabled by predictive and prescriptive analytics."
