                                        <Typography style={{ marginTop: '1vh', marginBottom: '2vh', }}>
                                        What-if analysis can benefit data-driven decision-making in enterprises by enabling business users to identify key data variables influencing business objectives, adjust data values to understand their
                                        impact on those objectives, and predict optimal data values to achieve the desired objectives. While business data analysis tools offer some interactive features to facilitate such advanced analysis,
                                        empirical evidence on how business users who lack formal technical training, perceive and value what-if analysis remains unclear. In response, we conduct a study with 22 business users to evaluate the
                                        effectiveness of a representative set of what-if analysis functionalities and assess its potential role in their decision-making workflows. We ask participants to complete a complex real-world task
                                        (marketing mix modeling) using what-if analysis and analyze their performance and feedback using a mixed-methods approach. We find that what-if data analysis improves business users' efficiency and confidence
                                        in decision-making. Our findings also suggest that better support for preparing data, assessing prediction risks, and incorporating domain knowledge can improve the user experience with existing what-if
                                        analysis functionalities. We discuss the implications of our findings for effectively incorporating what-if analysis in future business data analysis systems.
