                                        </Typography>
                                        <Typography className={classes.authors}>
                                            <b className={classes.bold}>Sneha Gathani</b>, Shayan Monadjemi, Alvitta Ottley, Leilani Battle
                                        </Typography>
                                        <div style={{ display: 'flex', flexDirection: 'row' }}>
